        private void button3_Click(object sender, EventArgs e)
        {
            OpenFileDialog openFileDialog = new OpenFileDialog();
            openFileDialog.InitialDirectory = Point_3DPath;//注意这里写路径时要用c:\\而不是c:\
            openFileDialog.Filter = "所有文件|*.*";
            openFileDialog.RestoreDirectory = true;
            openFileDialog.FilterIndex = 1;
            openFileDialog.Multiselect = true;
            if (openFileDialog.ShowDialog() == DialogResult.OK)
            {

                //所有需要画的数据
                List<str2DCouplingData> tData = new List<str2DCouplingData>();

                //str2DCouplingData d1 = new str2DCouplingData();

                //tData.Add(d1);


                //lst[0].SetData("12345678", tData.ToArray());


                string[] paths = openFileDialog.FileNames;

                List<float> listpoint = new List<float>();
                listpoint.Clear();


                foreach (var path in paths)
                {
                    if (File.Exists(path))//如果文件存在，则进行读取
                    {
                        Point_3DPath = System.IO.Path.GetDirectoryName(path);
                        string FileName = System.IO.Path.GetFileNameWithoutExtension(path);

                        using (StreamReader file = new StreamReader(File.Open(path, FileMode.Open)))
                        {
                            char[] separator = { ' ', ',', '\t' };//用于分割字符串的标示符号，即空格

                            List<double> x = new List<double>();
                            List<double> y = new List<double>();
                            List<double> p = new List<double>();

                            string line = file.ReadLine();//读取行;
                            do
                            {
                                string[] newstr = line.Trim().Split(separator);
                                if (newstr.Length >= 3)
                                {
                                    string strx = newstr[1];
                                    string stry = newstr[3];
                                    string strz = newstr[8];

                                    double fx, fy, fp;
                                    bool ok = true;
                                    ok &= double.TryParse(strx, out fx);
                                    ok &= double.TryParse(stry, out fy);
                                    ok &= double.TryParse(strz, out fp);
                                    if (ok)
                                    {
                                        x.Add(fx);
                                        y.Add(fy);
                                        p.Add(fp);
                                    }
                                }
                                line = file.ReadLine();//读取行                            
                            } while (line != null);

                            str2DCouplingData d1 = new str2DCouplingData()
                            {
                                Name = FileName,
                                X_Pos_mm = x.ToArray(),
                                Y_Pos_mm = y.ToArray(),
                                Power = p.ToArray()
                            };

                            tData.Add(d1);
                        }
                    }
                }

                coupling_Trajectory1.SetData("12345678", tData.ToArray());
                

            }
        }

